        "description": "Overview FASA Interactive was acquired by Microsoft in 1999. The company developed games exclusive to Microsoft platforms, both Windows PC and Xbox. Its headquarters were located in Redmond, WA, only a few miles from Microsoft's main campus. The studio was officially shutdown on September 12, 2007; more than half the studio's employees were provided with positions within Microsoft Game Studios.On October 15, 2007, Smith &amp; Tinker announced it had acquired licenses from Microsoft the rights for Weisman's previous works such as Shadow Run, MechWarrior, Crimson Skies and other FASA creations. Nothing is known what Smith &amp; Tinker is doing with the aforementioned works.",
