        "date_founded": "1994-10-01 00:00:00",
        "date_last_updated": "2014-09-29 18:35:18",
        "description": "Overview Monolith Productions (Monolith) is a developer based in Kirkland, Washington, founded by Jason Hall and a subsidiary of Warner Bros. Monolith internally developed the LithTech engine, which has since been used to power the majority of their games. Monolith also published many games between 1997 and 1999, with some games being developed internally and others by third party developers.Some of Monoliths recent hits include the F.E.A.R. and Condemned series. They are also known for the No One Lives Forever series, as well as the controversial Blood series.Monolith also created the game Shogo: Mobile Armor Division. The main theme for Shogo, 'Negai(Wish)' by Nemoto Miho, can be found playing on one of the radios in the original F.E.A.R.Monolith Productions also published other developers' games, including Septerra Core: Legacy of the Creator.",
