        "description": "Overview Zipper Interactive was founded in 1995 by Brian Soderberg and Jim Bosler. They were best known for their succesful SOCOM U.S Navy SEALS games series for Sonys PlayStation Portable and the PlayStation 2.In 2006, after these successful releases that sold over 10 million copies worldwide, Zipper Interactive was acquired by Sony.In 2010, they released their massively-multiplayer modern military first person shooter called MAG, short for Massive Action Game.On March 30th, 2012, Sony announced that it would be closing Zipper Interactive due to 'resource re - alignment.'",
