        "description": "Background and History Tigon Studios is a video game company founded by Vin Diesel in 2002. It is most well known for its games based on the Riddick character (from Pitch Black and The Chronicles of Riddick), the most recent of which is The Chronicles of Riddick: Assault on Dark Athena. This included both an updated version of Chronicles of Riddick: Escape From Butcher Bay and an entirely new campaign and multiplayer modes. Tigon also made Wheelman, a driving based game with shooting elements that involves stunts similar to those in action movies. Vin Diesel has played a character in all Tigon games.Games in DevelopmentAccording to the official Tigon website the studio has several games in development. The list of games currently being developed by Tigon are:Perrone: Raised on HonorMelkor - 'Melkor' is based on a character Vin Diesel created while playing the table top game D&amp;DBarca B.C.Unnamed Chronicles of Riddick SequelDescriptions of each can be found on the Tigon Studios homepage.",
