        "date_founded": "2008-08-27 00:00:00",
        "date_last_updated": "2013-10-03 09:32:08",
        "description": "Uber Entertainment is a game development team based in Kirkland, Washington that was founded in 2008 by a veteran team of developers. They boast that they are developing 'secret cutting edge technology and games that are sure to have a huge impact on the next decade of game development.'Their first game, Monday Night Combat, an online multiplayer shooter, has been released on Xbox LIVE Marketplace as part of the XBLA 2010 Summer of Arcade. A PC version was later released on January 24th 2011 and is available through Steam.In 2012 they worked on their next game, Super Monday Night Combat, which became a 3rd-Person MOBA/DotA style game.During the last months of 2012 they started a Kickstarter for Planetary Annihilation, which began development after gaining  ~$2 Million; releasing the Alpha to backers and pre-orders around the 1st week of June 2013, aiming to release the PA Beta in September, and fully in December.",
